package com.springcore.setterInjection.ref;

public class B {
	private int id;

	public B() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	@Override
	public String toString() {
		return "B [id=" + id + "]";
	}

	
	
	
}
